import Head from 'next/head'
import Navbar from './Navbar';
import "../css/style.css"
const Layout = (props) => (
    <div>
        <Head>
            <title></title>
            <link rel="stylesheet"
            href="https://bootswatch.com/4/united/bootstrap.min.css"/>
        </Head>
        <Navbar />
        <div className="container-fluid">
            {props.children}
        </div>

        <style jsx>{`
            .root {
                color: green;

            }
        `}</style>
    </div>
)

export default Layout;
